@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@base <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <> .

atm:Transaction a owl:Class .
atm:BankComputer a owl:Class .
atm:ATM a owl:Class .
atm:Message a owl:Class .

atm:sends a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Message .

atm:hasStatus a owl:DatatypeProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range xsd:string .

atm:transactionSucceeded a atm:Message ;
    rdfs:label "transaction succeeded"@en .

atm:TransactionSuccess a owl:Class ;
    rdfs:subClassOf atm:Transaction ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:hasStatus ;
                          owl:hasValue "succeeded"^^xsd:string ] .

atm:BankComputerSendsSuccessMessage a owl:Class ;
    rdfs:subClassOf atm:BankComputer ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:sends ;
                          owl:someValuesFrom atm:transactionSucceeded ] .

atm:TransactionSuccess rdfs:subClassOf [ a owl:Restriction ;
                                         owl:onProperty atm:sends ;
                                         owl:someValuesFrom atm:BankComputerSendsSuccessMessage ] .
